import React from "react";

function food({ fav }) {
  return <h3>I like {fav}</h3>
}

function App() {
  return (
    <div>
      <h3>Hello</h3>
      <food fav="beef" />
      <food fav="pork" />
      <food fav="chicken" />
    </div>
  );
}

export default App;
